import './style.scss';

export default function Authors() {
    return (
        <div className='authors'>
            <p>WebDesign Paulina Dziobek</p>
            <p>Animation Source: <a href='https://danielpietrasik.pl/'>danielpietrasik.pl</a></p>
        </div>
    )
};
